import React from 'react';
import { logout, artistOnly, userOnly, adminOnly } from '../Api/api';

const HomePage = () => {
    const handleLogout = async () => {
        try {
            await logout();
            console.log('Logged out successfully');
            localStorage.removeItem('token');

        } catch (error) {
            console.error('Error logging out:', error);
        }
    };
    const handleAdminOnly = async () => {
        try {
            await adminOnly();
            console.log('Admin endpoint accessed');

        } catch (error) {
            console.error('Error accessing admin endpoint:', error);
        }
    };
    const handleArtistOnly = async () => {
        try {
            await artistOnly();
            console.log('Artist endpoint accessed');
        } catch (error) {
            console.error('Error accessing artist endpoint:', error);
        }
    };
    const handleUserOnly = async () => {
        try {
            await userOnly();
            console.log('User endpoint accessed');
        } catch (error) {
            console.error('Error accessing user endpoint:', error);
        }
    };

    return (
        <div>
            <h2>Welcome to our Application</h2>
            <div>
                <button onClick={handleLogout}>Logout</button>
            </div>
            <div>
                <button onClick={handleArtistOnly}>Artist Only</button>
            </div>
            <div>
                <button onClick={handleUserOnly}>User Only</button>
            </div>
            <div>
                <button onClick={handleAdminOnly}>Admin Only (New)</button>
            </div>
        </div>
    );
};

export default HomePage;
